import React from 'react'
import  {connect} from 'react-redux'


export class layout extends React.Component {
  constructor(props){
    super(props)
    
  }

  rendert1(){
      return this.props.optimized[0].step1.map((optim, index) => {
        const { alloc} = optim //destructuring
         return (
            <tr key="t1" className="cell_1">
               <td className="cell_1">{optim}</td>
            </tr>
         )
      })
  }

  render() {

    //console.log(this.props.optimized)
    //if(!this.props.optimized)return null;
    return (
        <div id="layout">
        <div className="container">
             <h2>Layout</h2>
             
            <ul id="weekdays">
            <li className= "active">
              M  
            </li>
            <li>
              T  
            </li>
            <li>
              W
            </li>            
            <li>             
             T  
            </li>           
            <li>
            F
            </li>            
            <li>
            S 
            </li>            
            <li>
             S   
            </li> 

            </ul> 
            <div className="list-style">
                  
          </div>
        </div>
        
        <div id = "layout_img">
            
        <table id = "t2">
               <tr>
                <td>Step1</td>
               </tr>
               <tr>
                <td>Step2</td>
               </tr>
               <tr>
                <td>Step3</td>
               </tr>
             </table>
            
        </div>
        <a className = "layout_labels">LINE 1</a>
        <a className = "layout_labels">LINE 2</a>
        <a className = "layout_labels">LINE 3</a>
        <div id = "layout_img2">
            
        </div>
        <a className = "layout_labels">LINE 4</a>
        <a className = "layout_labels">LINE 5</a>
        <a className = "layout_labels">LINE 6</a>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
  // console.log(state);
  return {
   optimized : state.optimized[0]
  };
};


export default connect(mapStateToProps,null) (layout)
